></i>\r\n              牛奶乳品\r\n            </span>\r\n            <span>\r\n              <i class=\"fa fa-home\"></i>\r\n              家乡味道\r\n            </span>\r\n            <span>\r\n              <i class=\"fa fa-home\"></i>\r\n              休闲零食\r\n            </span>\r\n            <span>\r\n              <i class=\"fa fa-home\"></i>\r\n              米面粮油\r\n            </span>\r\n          </li>\r\n          <li>\r\n            <span>\r\n              <i class=\"fa fa-home\"></i>\r\n              调味调料\r\n            </span>\r\n            <span>\r\n              <i class=\"fa fa-home\"></i>\r\n              酒水饮料\r\n            </span>\r\n            <span>\r\n              <i class=\"fa fa-home\"></i>\r\n              生鲜果蔬\r\n            </span>\r\n            <span>\r\n              <i class=\"fa fa-home\"></i>\r\n              进口食品\r\n            </span>\r\n          </li>\r\n        </ul>\r\n        <!-- advertise -->\r\n        <div class=\"advertise\">\r\n          <span class=\"orange\">\r\n            商城动态\r\n          </span>\r\n          <span class=\"adverCont swiper-container\">\r\n            <div class=\"swiper-wrapper\">\r\n              <div class=\"swiper-slide\">\r\n                7.17安全食品商城周年庆，暑期放价嗨不停！好吃、安全、放心的食品，陪你度假期！\r\n              </div>\r\n              <div class=\"swiper-slide\">\r\n                717商城社区服务功能正式上线！抢红包！晒家乡！好吃、好玩、好看尽在717商城社区！\r\n              </div>\r\n            </div>\r\n          </span>\r\n        </div>\r\n        <div class=\"today\">\r\n          <span>\r\n            <i class=\"fa fa-home\"></i>\r\n            天天特惠\r\n            <small>每天有惊喜</small>\r\n          </span>\r\n          <span class=\"more\">\r\n            更多<i class=\"fa fa-angle-right\"></i>\r\n          </span>\r\n        </div>\r\n        <div class=\"box\">\r\n          <goods v-for='(val, key) in data' :key='key' :val='val'></goods>\r\n        </div>\r\n        <p class=\"lastP\" v-show=\"isShow\">我是有底线的</p>\r\n      </div>\r\n    </se